import React from 'react'

const TodoList = () => {

    const items = ['Drink Coffee', 'Build Awesome App']
    return (
        <ul>
            <li>{items[0]}</li>
            <li>{items[1]}</li>
        </ul>
    );
};

export default TodoList;
